import React from 'react'


class MyHome extends React.Component {
    constructor(props) {
        super(props);
     
        this.state = {
          data: null,
        };
      }
      componentDidMount() {
        fetch('/mymensa')
          .then(response => response.json())
          .then(data => this.setState({ data }));
      }

    render(){
        return(
            
            <p>{this.state.data.id}</p>
            
        )
    }
}
export default MyHome
